package com.xem.mzbemployeeapp.entity;import java.io.Serializable;public class Experience implements Serializable{	private static final long serialVersionUID = 719444187L;	private ExperEmploye employe;	private String token;	private long uid;	private boolean isemploye;	public ExperEmploye getEmploye() {		return this.employe;	}	public void setEmploye(ExperEmploye employe) {		this.employe = employe;	}	public String getToken() {		return this.token;	}	public void setToken(String token) {		this.token = token;	}	public long getUid() {		return this.uid;	}	public void setUid(long uid) {		this.uid = uid;	}	public boolean getIsemploye() {		return this.isemploye;	}	public void setIsemploye(boolean isemploye) {		this.isemploye = isemploye;	}	public Experience() {}	public Experience(ExperEmploye employe, String token, long uid, boolean isemploye){		super();		this.employe = employe;		this.token = token;		this.uid = uid;		this.isemploye = isemploye;	}}